import React from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Image } from 'react-native';
import { useRouter } from 'expo-router';
import { Heart, Download, MessageSquare, Bookmark, BookmarkCheck } from 'lucide-react-native';
import { Note } from '@/types';
import { colors } from '@/constants/colors';
import { useNotesStore } from '@/store/notes-store';
import { Scale } from './animations/Scale';
import { Card } from './ui/Card';

interface NoteCardProps {
  note: Note;
  compact?: boolean;
  delay?: number;
}

export const NoteCard: React.FC<NoteCardProps> = ({ note, compact = false, delay = 0 }) => {
  const router = useRouter();
  const { toggleBookmark, toggleLike } = useNotesStore();

  const handlePress = () => {
    router.push(`/note/${note.id}`);
  };

  const handleBookmark = (e: any) => {
    e.stopPropagation();
    toggleBookmark(note.id);
  };

  const handleLike = (e: any) => {
    e.stopPropagation();
    toggleLike(note.id);
  };

  if (compact) {
    return (
      <Scale delay={delay} duration={400}>
        <TouchableOpacity 
          style={styles.compactContainer} 
          onPress={handlePress}
          activeOpacity={0.7}
        >
          <Image 
            source={{ uri: note.thumbnailUrl }} 
            style={styles.compactThumbnail} 
          />
          <View style={styles.compactContent}>
            <Text style={styles.compactTitle} numberOfLines={2}>{note.title}</Text>
            <Text style={styles.compactSubject}>{note.subject}</Text>
            <View style={styles.compactStats}>
              <View style={styles.statItem}>
                <View style={styles.iconWrapper}>
                  <Heart size={14} color={note.isLiked ? colors.error : colors.textTertiary} />
                </View>
                <Text style={styles.statText}>{note.likes}</Text>
              </View>
              <View style={styles.statItem}>
                <View style={styles.iconWrapper}>
                  <Download size={14} color={colors.textTertiary} />
                </View>
                <Text style={styles.statText}>{note.downloads}</Text>
              </View>
            </View>
          </View>
        </TouchableOpacity>
      </Scale>
    );
  }

  return (
    <Scale delay={delay} duration={400}>
      <TouchableOpacity 
        style={styles.container} 
        onPress={handlePress}
        activeOpacity={0.7}
      >
        <Image 
          source={{ uri: note.thumbnailUrl }} 
          style={styles.thumbnail} 
        />
        <View style={styles.content}>
          <View style={styles.header}>
            <Text style={styles.title} numberOfLines={2}>{note.title}</Text>
            <TouchableOpacity onPress={handleBookmark} style={styles.bookmarkButton}>
              <View style={styles.iconWrapper}>
                {note.isBookmarked ? (
                  <BookmarkCheck size={20} color={colors.primary} />
                ) : (
                  <Bookmark size={20} color={colors.textTertiary} />
                )}
              </View>
            </TouchableOpacity>
          </View>

          <Text style={styles.description} numberOfLines={2}>{note.description}</Text>

          <View style={styles.metaContainer}>
            <View style={[styles.badge, { backgroundColor: colors.primaryLight }]}>
              <Text style={[styles.badgeText, { color: colors.primary }]}>{note.subject}</Text>
            </View>
            <View style={[styles.badge, { backgroundColor: colors.secondaryLight }]}>
              <Text style={[styles.badgeText, { color: colors.secondary }]}>{note.class}</Text>
            </View>
          </View>

          <View style={styles.footer}>
            <View style={styles.uploaderInfo}>
              <Image 
                source={{ uri: note.uploaderAvatar || 'https://images.unsplash.com/photo-1599566150163-29194dcaad36' }} 
                style={styles.avatar} 
              />
              <Text style={styles.uploaderName}>{note.uploaderName}</Text>
            </View>

            <View style={styles.stats}>
              <TouchableOpacity style={styles.statItem} onPress={handleLike}>
                <View style={styles.iconWrapper}>
                  <Heart size={16} color={note.isLiked ? colors.error : colors.textTertiary} fill={note.isLiked ? colors.error : 'transparent'} />
                </View>
                <Text style={styles.statText}>{note.likes}</Text>
              </TouchableOpacity>

              <View style={styles.statItem}>
                <View style={styles.iconWrapper}>
                  <Download size={16} color={colors.textTertiary} />
                </View>
                <Text style={styles.statText}>{note.downloads}</Text>
              </View>

              <View style={styles.statItem}>
                <View style={styles.iconWrapper}>
                  <MessageSquare size={16} color={colors.textTertiary} />
                </View>
                <Text style={styles.statText}>{note.comments}</Text>
              </View>
            </View>
          </View>
        </View>
      </TouchableOpacity>
    </Scale>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: colors.card,
    borderRadius: 16,
    overflow: 'hidden',
    marginBottom: 16,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.05,
    shadowRadius: 8,
    elevation: 2,
  },
  thumbnail: {
    width: '100%',
    height: 160,
    resizeMode: 'cover',
  },
  content: {
    padding: 16,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'flex-start',
    marginBottom: 8,
  },
  title: {
    fontSize: 18,
    fontWeight: '600',
    color: colors.text,
    flex: 1,
    marginRight: 8,
  },
  bookmarkButton: {
    padding: 4,
  },
  description: {
    fontSize: 14,
    color: colors.textSecondary,
    marginBottom: 12,
  },
  metaContainer: {
    flexDirection: 'row',
    marginBottom: 16,
    flexWrap: 'wrap',
    gap: 8,
  },
  badge: {
    paddingHorizontal: 10,
    paddingVertical: 4,
    borderRadius: 12,
  },
  badgeText: {
    fontSize: 12,
    fontWeight: '500',
  },
  footer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  uploaderInfo: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  avatar: {
    width: 24,
    height: 24,
    borderRadius: 12,
    marginRight: 8,
  },
  uploaderName: {
    fontSize: 13,
    color: colors.textSecondary,
    fontWeight: '500',
  },
  stats: {
    flexDirection: 'row',
    gap: 12,
  },
  statItem: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 4,
  },
  statText: {
    fontSize: 12,
    color: colors.textTertiary,
  },

  // Compact styles
  compactContainer: {
    flexDirection: 'row',
    backgroundColor: colors.card,
    borderRadius: 12,
    overflow: 'hidden',
    marginBottom: 12,
    height: 100,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 1 },
    shadowOpacity: 0.05,
    shadowRadius: 4,
    elevation: 1,
  },
  compactThumbnail: {
    width: 100,
    height: '100%',
    resizeMode: 'cover',
  },
  compactContent: {
    flex: 1,
    padding: 12,
    justifyContent: 'space-between',
  },
  compactTitle: {
    fontSize: 14,
    fontWeight: '600',
    color: colors.text,
    marginBottom: 4,
  },
  compactSubject: {
    fontSize: 12,
    color: colors.primary,
    fontWeight: '500',
  },
  compactStats: {
    flexDirection: 'row',
    gap: 12,
  },
  iconWrapper: {
    // Wrapper to ensure icons are properly contained
  }
});
